import React from "react";
import styled from "styled-components";

const MainBox = styled.div`
    
`
const CardBox = styled.div`
    width: 480px;
  height: 480px;
  background-color: gray;
  border-radius:5px;
  box-shadow: 0px 0px 3px 2px  lightgray;
`
const CardTitle = styled.p`
    font-size: 25px;
  font-weight: 400;
  color: white;
  position: absolute;
  margin-top: 150px;
  margin-left: 180px;
`
const ContentBox = styled.div`
    width: 480px;
    height:190px;
    background-color: white;
    border-radius:0px 0px 5px 5px;
    position: absolute;
   margin-top: 290px;
`
const CardContent = styled.p`
    font-size: 20px;
  font-weight: 500;
  text-align: left;
  margin-left: 23px;
  margin-right: 40px;
  line-height: 33px;
`
const CardButton1 = styled.div`
    width: 70px;
    height: 30px;
    border: 2px solid black;
    margin-left: 30px;
`
const ButtonText1 = styled.p`
  font-size: 20px;
  font-weight: 100;
`
const CardButton2 = styled.div`
    width: 70px;
    height: 30px;
`
const ButtonText2 = styled.p`
   font-size: 20px;
  font-weight: 100;
`
const Box = styled.div`
    display:inline-block;
    flex-direction: row;
`

const Main = (props) =>{
    return(
        <>
        <MainBox>
            <CardBox>
                <CardTitle>{props.cardTitle}</CardTitle>
              <ContentBox>
                <CardContent>{props.cardContent}</CardContent>
                <Box>
                  <CardButton1>
                  <ButtonText1>View</ButtonText1>
                  </CardButton1>
                 <CardButton2>
                  <ButtonText2>Edit</ButtonText2>
                  </CardButton2>
                </Box>
              </ContentBox>
            </CardBox>
        </MainBox>
        </>
    )
}
export default Main;
